import { React, useState } from 'react'
import { Box } from '@mui/material';
import Header from '../Header';
import { Form } from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css';



function LogTransaction() {
    const [formData, setFormData] = useState({
        recipients: [],
        category: '',
        price: '',
        description: '',
        payer: ''
    });

    const [errors, setErrors] = useState({});

    const handleCheckboxChange = (e) => {
        /**
         * Testing zone
         * 
         */

        console.log({ e });

        // end of testing zone
        const { name, checked } = e.target;
        setFormData((prev) => ({
            ...prev,
            recipients: checked
                ? [...prev.recipients, name]
                : prev.recipients.filter((recipient) => recipient !== name)
        }));
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const validate = () => {
        const newErrors = {};
        if (!formData.recipients.length) newErrors.recipients = "Please select at least one recipient.";
        if (!formData.category) newErrors.category = "Please select a category.";
        if (!formData.price || isNaN(formData.price)) newErrors.price = "Price must be a valid number.";
        if (!formData.description) newErrors.description = "Description is required.";
        if (!formData.payer) newErrors.payer = "Please select who paid.";
        setErrors(newErrors);
        return Object.keys(newErrors).length === 0;
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (validate()) {
            alert('Form submitted successfully!');
            // Submit form logic here
        }
    };


    return (
        <Box m='20px'>
            <Box display={'flex'} justifyContent={'space-between'} alignItems={'center'}>
                <Header title={'Log Transaction'} subtitle={'Log an expense here'} />
            </Box>

            {/* <Form>
                <Form.Group className='mb-4' controlId='testformgroup'>
                    <Form.Label>Who is it for?</Form.Label>
                    <Form.Control type='number' placeholder='$-.--' />
                </Form.Group>
                <Form.Group className='mb-3' controlId='testformgroup'>
                    <Form.Label>Category</Form.Label>
                    <Form.Control type='number' placeholder='$-.--' />
                </Form.Group>
                <Form.Group className='mb-3' controlId='testformgroup'>
                    <Form.Label>Price</Form.Label>
                    <Form.Control type='number' placeholder='$-.--' />
                </Form.Group>
                <Form.Group className='mb-3' controlId='testformgroup'>
                    <Form.Label>Description</Form.Label>
                    <Form.Control type='number' placeholder='$-.--' />
                </Form.Group>
                <Form.Group className='mb-3' controlId='testformgroup'>
                    <Form.Label>Who paid?</Form.Label>
                    <Form.Select>
                        <option>yl</option>
                        <option>en</option>
                        <option>dj</option>
                        <option>chubby</option>
                    </Form.Select>
                </Form.Group>
            </Form> */}

            <form onSubmit={handleSubmit} className="container mt-4">
                <div className="mb-3">
                    <label className="form-label">Who is it for?</label><br />
                    <div className="form-check">
                        <input type="checkbox" name="Alice" className="form-check-input" onChange={handleCheckboxChange} />
                        <label className="form-check-label">Alice</label>
                    </div>
                    <div className="form-check">
                        <input type="checkbox" name="Bob" className="form-check-input" onChange={handleCheckboxChange} />
                        <label className="form-check-label">Bob</label>
                    </div>
                    {errors.recipients && <div className="text-danger">{errors.recipients}</div>}
                </div>

                <div className="mb-3">
                    <label htmlFor="category" className="form-label">Category</label>
                    <select name="category" id="category" className="form-select" onChange={handleChange}>
                        <option value="">Select Category</option>
                        <option value="Food">Food</option>
                        <option value="Transport">Transport</option>
                        <option value="Entertainment">Entertainment</option>
                    </select>
                    {errors.category && <div className="text-danger">{errors.category}</div>}
                </div>

                <div className="mb-3">
                    <label htmlFor="price" className="form-label">Price</label>
                    <input
                        type="text"
                        name="price"
                        id="price"
                        className="form-control"
                        value={formData.price}
                        onChange={handleChange}
                    />
                    {errors.price && <div className="text-danger">{errors.price}</div>}
                </div>

                <div className="mb-3">
                    <label htmlFor="description" className="form-label">Description</label>
                    <textarea
                        name="description"
                        id="description"
                        className="form-control"
                        rows="3"
                        value={formData.description}
                        onChange={handleChange}
                    ></textarea>
                    {errors.description && <div className="text-danger">{errors.description}</div>}
                </div>

                <div className="mb-3">
                    <label htmlFor="payer" className="form-label">Who Paid?</label>
                    <select name="payer" id="payer" className="form-select" onChange={handleChange}>
                        <option value="">Select Payer</option>
                        <option value="Alice">Alice</option>
                        <option value="Bob">Bob</option>
                    </select>
                    {errors.payer && <div className="text-danger">{errors.payer}</div>}
                </div>

                <button type="submit" className="btn btn-primary">Submit</button>
            </form>
        </Box>
    )
}

export default LogTransaction;
